package org.rothmayer.UltiShot.Util;

import java.io.File;
import java.io.IOException;
import java.nio.charset.Charset;
import java.nio.file.Files;
import java.nio.file.OpenOption;
import java.nio.file.StandardOpenOption;
import java.text.SimpleDateFormat;
import java.util.Date;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

public class HtmlWorker {

	String header = "<!DOCTYPE html>\r\n<html>\r\n<head>\r\n<meta http-equiv='content-type' content='text/html; charset=ISO-8859-1'>\r\n<style type='text/css'>\r\nbody {\r\n  font-family: sans-serif;\r\n  background-color: white;\r\n  color: black;\r\n}\r\ntable {\r\n  width: 100%;\r\n  border-collapse: collapse;\r\n  font-size: 11pt;\r\n}\r\n.font24Bold {\r\n  font-size: 24pt;\r\n  font-weight: bold;\r\n}\r\n.font18Bold {\r\n  font-size: 18pt;\r\n  font-weight: bold;\r\n}\r\n.font10Bold {\r\n  font-size: 10pt;\r\n  font-weight: bold;\r\n}\r\n.font10 {\r\n  font-size: 10pt;\r\n}\r\n.resultStatus {\r\n  font-size: 18pt;\r\n  font-weight: bold;\r\n}\r\n.revised {\r\n  font-size: 18pt;\r\n  font-weight: bold;\r\n  color: white;\r\n  background-color: black;\r\n  padding-left: 50px;\r\n  padding-right: 50px;\r\n  padding-top: 2px;\r\n  padding-bottom: 2px;\r\n}\r\n.result th {\r\n  padding: 5px;\r\n  border: 1px solid black;\r\n  background-color: DarkGray;\r\n}\r\n.result td {\r\n  padding: 5px;\r\n  border-left: 1px solid black;\r\n  border-right: 1px solid black;\r\n}\r\n.result tr:nth-child(odd) {\r\n  background-color: LightGray;\r\n}\r\n.result tr:last-child td {\r\n  border-left: 1px solid black;\r\n  border-right: 1px solid black;\r\n  border-bottom: 1px solid black;\r\n}\r\n</style>\r\n</head>\r\n<body>\r\n<table>\r\n<tr>\r\n<td width='20%' rowspan='5' align='left' valign='middle'><img width='100' src='data:image;base64,'></td><td width='60%' align='center' style='font-size:18pt'><b>Dorfschiessen 2018</b></td>\r\n<td width='20%' rowspan='5' align='right' valign='middle'><img width='100' height='100' src='data:image/png;base64,'></td>\r\n</tr>\r\n<tr><td align='center'></td></tr>\r\n<tr><td align='center'></td></tr>\r\n<tr><td align='center'></td></tr>\r\n</table>\r\n<br>";
	String veranstaltung ="<table class='resultStatus'>\r\n<tr>\r\n<td>ERGEBNISSE</td>\r\n</tr>\r\n<tr>\r\n<td>Hobby Mannschaftswertung %v</td>\r\n</tr>\r\n</table>\r\n<br>";
	String tabelStart ="<table class='result'>\r\n  <tbody>";
	String tabelHead = "<tr>\r\n      <th scope=\"col\">Platz</th>\r\n      <th colspan=\"2\" scope=\"col\">Mannschaft</th>\r\n      <th scope=\"col\">Ergebniss </th>\r\n</tr>";
	String teamHead = "<tr>\r\n      <th scope=\"col\">%mp</th>\r\n      <th colspan=\"2\" scope=\"col\">%mn</th>\r\n      <th scope=\"col\">%mw</th>\r\n    </tr>";
	String schtzeW = "<tr>\r\n      <td align='right'>%sp</td>\r\n      <td align='right'>%sid</td>\r\n      <td>%sn - %kl</td>\r\n      <td>%sw</td>\r\n    </tr>";
	String sep = "<tr>\r\n      <td align='center' colspan=\"4\" height=\"4px\">Ungewertete Sch\u00FCtzen</td>\r\n    </tr>";
	String endHtml ="</tbody>\r\n</table>\r\n<p>\r\n<table>\r\n<tr>\r\n<td align='left'><font color='#25383C'>&copy; Florian Rothmayer 2016</font></td>\r\n<td align='center'>%mel</td>\r\n<td align='right'><font color='#25383C'>%date</font></td>\r\n</tr>\r\n</table>\r\n</p>\r\n</body>\r\n</html>";
	//File htmlFile = new File("\\\\192.168.10.200\\ergebnis\\HTML\\mannschaft.html");
	File htmlFile = new File("\\\\192.168.10.200\\html\\mannschaft.html");
	List<Team> teams;
	Map<String, Integer> beteiligung = new HashMap<String, Integer>();
	String vName;
	int mannschaftsgr;
	int meldungen;
	
	public HtmlWorker(List<Team> teams, String vName, int mannschftsgr) {
		this.teams = teams;
		this.vName = vName;
		this.mannschaftsgr = mannschftsgr;
		meldungen = 0;
		
		if(teams.size() == 0){
			return;
		}
		
		String text = "";
		
		text = text + header + veranstaltung + tabelStart + tabelHead;
		
		text = text.replace("%v", vName);
		int teamer = teams.get(0).getErgebniss();
		int teamp = 1;
		
		
		for(int t = 0; t < teams.size(); t++){
			Team team = teams.get(t);
			
			if(team.getSchtzenAnzeige().size() == 0){
				continue;
			}
			beteiligung.put(team.getName(), team.getSchtzenAnzeige().size());
			text = text + teamHead;
			
			if(!(team.getErgebniss() == teamer)){
				teamp = t+1;
				teamer = team.getErgebniss();
				text = text.replace("%mp", ""+(t+1));
			}else{
				text = text.replace("%mp", ""+teamp);
			}
			
			
			text = text.replace("%mn", team.getName());
			text = text.replace("%mw", ""+(team.getErgebniss()/10));
			
			int sche = team.getSchtzenAnzeige().get(0).getGesamt();
			int schp = 1;
			
			for(int s = 0; s < team.getSchtzenAnzeige().size(); s++){
				
				Schtze schtze = team.getSchtzenAnzeige().get(s);
				
				//System.out.println(team.getSchtzenAnzeige().size());
				//System.out.println("Schtze" + s +" " + "Grsse" + mannschftsgr);
				if(s == team.getSepPlace()){ //mannschftsgr
					
					text = text + sep;
				}
				
				text = text + schtzeW;
				
				if(!(schtze.getGesamt() == sche)){
					schp = s+1;
					sche = schtze.getGesamt();
					text = text.replace("%sp", ""+(s+1));
				}else{
					text = text.replace("%sp", ""+ schp);
				}
				meldungen++;
				SimpleDateFormat year = new SimpleDateFormat( "yy" );
				//try {
					text = text.replace("%sid", ""+schtze.getStarternummer());
					//System.out.println(schtze.getStarternummer());
					String gb = "--";
					
					if(schtze.getGb() != null){
						gb = year.format(schtze.getGb());
					}
					text = text.replace("%sn", ""+schtze.getNachname() + " " + schtze.getVorname() + " " + gb);
					text = text.replace("%kl", ""+schtze.getZuordnung());
					text = text.replace("%sw", ""+(schtze.getGesamt()/10));
				//} catch (Exception e) {
				//}
			}
			
		}
		
		text = text + endHtml;
		
		Date dt = new Date();
		// Festlegung des Formats:
		SimpleDateFormat dd = new SimpleDateFormat( "dd.MM.yyyy" );

		SimpleDateFormat dz = new SimpleDateFormat( "HH:mm:ss" );
		
		text = text.replace("%date", "generiert am " + dd.format(dt) + " um " + dz.format(dt));
		text = text.replace("%mel", meldungen + " Meldungen gesamt");
		
		File csvFile = new File("\\\\192.168.10.200\\html\\beteiligung.csv");
		String csv = "";
		for(String name : beteiligung.keySet()){
			csv = csv + name +";" + beteiligung.get(name) + ";\r\n";
		}
		
		
		if(htmlFile.exists()){
			htmlFile.delete();
		}
		try {
			htmlFile.createNewFile();
		} catch (IOException e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
		}
		
		if(csvFile.exists()){
			csvFile.delete();
		}
		try {
			csvFile.createNewFile();
		} catch (IOException e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
		}
		
		try {
			Files.write(csvFile.toPath(), csv.getBytes(), StandardOpenOption.APPEND);
		} catch (IOException e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
		}
		
		try {
			Files.write(htmlFile.toPath(), text.getBytes(), StandardOpenOption.APPEND);
		} catch (IOException e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
		}
	}
}
